import '../style/content.css';
import Filter from './filter';
import movieGrid from './movie-grid';

const Content = () => {
    return (
        <div className="main">
            <div className="content">
                <Filter></Filter>
                <MovieGrid></MovieGrid>
            </div>
        </div>
    );
};

export default Content;
